const API = "http://localhost:5000/questions/showAll"

class Landing extends Component {

  constructor(props) {
    super(props);
    this.state = {
        hits: [],
    };
}


componentDidMount(){
  fetch(API)
  .then(response => {response.json()})
  .then(responseData => {console.log(responseData)})
  .then(data => {this.setState({hits: data})})
}
  render() {
    return (
      <div></div>
    );
  }
}

